import "./signup_style.css"


export default function SignUp({open ,children, toggleModal}){
    if(!open){
        return null;
    }
    return(
        <>
        
            <div className="sign-up">
                {children}
                <button onClick={toggleModal(false)}>Close</button>
            </div>
           
        </>
    );
}
